import React, { Component } from "react";

class AgentEdit extends Component {
  componentDidMount() {
    const Agent = props => {
      console.log(this.props.location.state);
    };
    Agent();
  }
  render() {
    const name = this.props.location.state;
    return (
      <div>
        <p>{name}</p>
      </div>
    );
  }
}

export default AgentEdit;
